import { Component } from '@angular/core';

@Component({
  selector: 'app-filter',
  templateUrl: './filter.component.html',
  styleUrls: ['./filter.component.css']
})
export class FilterComponent {
  data:any={ languages:['Telugu','Hindi','English','Malayalam','Punjabi','Marati','Gujarati'],
             genere:['Action','Animation','Biography','Comedy','Crime','Darama']}
             keysOfUsersArray(){
              return Object.keys(this. data) //return type Array
            }

